-- ----------------------------
--  Table structure for `pro_crowdfunding`
-- ----------------------------
DROP TABLE IF EXISTS `pro_crowdfunding`;
CREATE TABLE `pro_crowdfunding` (
  `project_id` varchar(32) NOT NULL COMMENT '主键',
  `user_code` varchar(50) DEFAULT NULL COMMENT '用户id',
  `project_name` varchar(40) DEFAULT NULL COMMENT '项目名',
  `project_stage` int(11) DEFAULT NULL COMMENT '项目所属阶段',
  `company_name` varchar(100) DEFAULT NULL COMMENT '公司名称',
  `real_name` varchar(20) DEFAULT NULL COMMENT '真实姓名',
  `office_address` varchar(255) DEFAULT NULL COMMENT '办公地址编码',
  `office_detail` varchar(255) DEFAULT NULL COMMENT '办公地址详情',
  `team_count` int(11) DEFAULT NULL COMMENT '团队人数',
  `ipo_stage` int(11) DEFAULT NULL COMMENT '融资阶段',
  `project_desc` varchar(2000) DEFAULT NULL COMMENT '項目介紹',
  `project_desc_detail` varchar(8000) DEFAULT NULL COMMENT '項目介紹',
  `publicity_video` varchar(500) DEFAULT NULL COMMENT '视频地址',
  `cover_picture` varchar(1000) CHARACTER SET utf8 DEFAULT '' COMMENT '白皮书地址',
  `rich_text` varchar(300) DEFAULT '' COMMENT '富文本路径',
  `invest_coin_type` int(11) DEFAULT NULL COMMENT '投资币种类型(1.BTC 2.ETH 3.LTC)',
  `invest_limit` int(11) DEFAULT '0' COMMENT '是否有限额 ',
  `invest_amount` decimal(15,7) DEFAULT NULL COMMENT '投资金额',
  `repay_desc` varchar(2000) DEFAULT NULL COMMENT '回报说明',
  `quota_limit` int(11) DEFAULT '0' COMMENT '名额限制',
  `support_limit` int(11) DEFAULT NULL COMMENT '支持限制',
  `is_free_deliver` int(11) DEFAULT NULL COMMENT '是否包邮',
  `repay_period` int(11) DEFAULT NULL COMMENT '回报时间',
  `ico_period` int(11) DEFAULT NULL COMMENT 'ico天数',
  `target_limit` int(11) DEFAULT NULL COMMENT '是否有限额(0:无限额 ,1：有限额)',
  `target_type` int(11) DEFAULT NULL COMMENT '目标类型',
  `invest_rate` decimal(10,4) DEFAULT '0.0000' COMMENT '投资比率',
  `invest_btc_count` decimal(10,4) DEFAULT NULL COMMENT '投资比特币数量',
  `invest_eth_count` decimal(10,4) DEFAULT NULL COMMENT '投资以太坊数量',
  `invest_ltc_count` decimal(10,4) DEFAULT NULL COMMENT '投资莱特币数量',
  `invest_san_count` decimal(10,4) DEFAULT NULL COMMENT '投资三界宝数量',
  `invest_count` decimal(10,4) DEFAULT '0.0000' COMMENT '当前总投资多少个',
  `target_amount` decimal(10,0) DEFAULT '0' COMMENT '目标金额',
  `contact_name` varchar(40) DEFAULT NULL COMMENT '联系人',
  `job_position` varchar(40) DEFAULT NULL COMMENT '负责职位',
  `contact_tel` char(11) DEFAULT NULL COMMENT '联系电话',
  `service_charge` decimal(5,4) DEFAULT '0.0000' COMMENT '手续费(%)',
  `start_time` datetime DEFAULT NULL COMMENT '开始时间',
  `end_time` datetime DEFAULT NULL COMMENT '结束时间',
