-- ----------------------------
--  Table structure for `pro_crowdfunding_attachment`
-- ----------------------------
DROP TABLE IF EXISTS `pro_crowdfunding_attachment`;
CREATE TABLE `pro_crowdfunding_attachment` (
  `id` varchar(32) CHARACTER SET utf8 NOT NULL DEFAULT '' COMMENT '主键',
  `project_id` varchar(32) DEFAULT NULL COMMENT '项目id',
  `type` int(11) DEFAULT NULL COMMENT '附件类型1白皮书2商业计划书3其他资料',
  `path` varchar(255) DEFAULT NULL COMMENT '附件路径',
  `status` varchar(1) DEFAULT NULL COMMENT '状态1再用0删除',
  `create_time` timestamp NULL DEFAULT NULL ON UPDATE CURRENT_TIMESTAMP COMMENT '创建时间',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COMMENT='ICO项目附件';

-- ----------------------------
--  Table structure for `pro_crowdfunding_detail`
-- ----------------------------
DROP TABLE IF EXISTS `pro_crowdfunding_detail`;
CREATE TABLE `pro_crowdfunding_detail` (
  `crowdfunding_detail_id` bigint(11) NOT NULL AUTO_INCREMENT,
  `project_id` varchar(32) DEFAULT NULL COMMENT '参与锁定众筹项目ID',
  `lock_project_start_time` datetime DEFAULT NULL COMMENT '锁定众筹项目开始时间',
  `lock_project_end_time` datetime DEFAULT NULL COMMENT '锁定众筹项目结束时间',
  `target_lock_amount` decimal(10,4) DEFAULT NULL COMMENT '目标锁定金额',
  `lock_max_amount` decimal(10,4) DEFAULT '1.0000' COMMENT '锁定最大可投金额，默认是1',
  `lock_min_amount` decimal(10,4) DEFAULT '0.0100' COMMENT '锁定最小可投金额，默认是0.01',
  `actual_lock_amount` decimal(10,4) DEFAULT '0.0000' COMMENT '实际锁定金额',
  `actual_lock_rate` decimal(10,4) DEFAULT '0.0000' COMMENT '实际锁定金额所占比例',
  `create_time` datetime DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `update_time` datetime DEFAULT CURRENT_TIMESTAMP COMMENT '更新时间',
  `ext1` varchar(32) NOT NULL DEFAULT '' COMMENT '备用字段',
  `lock_back_rate` decimal(10,4) DEFAULT '0.0000' COMMENT '项目投资回报率',
  PRIMARY KEY (`crowdfunding_detail_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COMMENT='ICO众筹项目详情表';

-- ----------------------------
--  Table structure for `pro_crowdfunding_price`
-- ----------------------------
DROP TABLE IF EXISTS `pro_crowdfunding_price`;
CREATE TABLE `pro_crowdfunding_price` (
  `price_id` varchar(32) NOT NULL,
  `project_id` varchar(32) DEFAULT NULL COMMENT '项目Id',
  `order_type` varchar(50) DEFAULT NULL COMMENT '币种（1BTC，2ETH，3LTC，4USD，5RMB）',
  `price` decimal(20,4) DEFAULT NULL COMMENT '单价',
  `create_time` timestamp NULL DEFAULT NULL COMMENT '创建时间',
  `modify_time` timestamp NULL DEFAULT NULL ON UPDATE CURRENT_TIMESTAMP COMMENT '修改时间',
  `operator` varchar(200) DEFAULT NULL COMMENT '修改人',
  PRIMARY KEY (`price_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4;

