DROP TABLE IF EXISTS `pro_support_amount`;
CREATE TABLE `pro_support_amount` (
  `support_amount_id` int(11) NOT NULL AUTO_INCREMENT COMMENT '订单ID',
  `project_id` varchar(32) DEFAULT NULL COMMENT '参与ICO项目ID',
  `user_code` varchar(200) DEFAULT NULL,
  `account` varchar(100) DEFAULT NULL COMMENT '帐户名',
  `invest_amount` decimal(10,4) DEFAULT '0.0000' COMMENT '投资金额',
