(case when new.bouns_source1 = '15' then CONCAT('恭喜您获得推介会员【',(select phone FROM tb_user_detail  where user_code = new.rela_usercode),'】购买SAN币时系统赠送的',new.amnt,'SAN币奖励。') end)
 FROM tb_user_detail where user_code = new.user_code;
end;

-- ----------------------------
--  Triggers structure for table tb_acc_detail
-- ----------------------------
CREATE TRIGGER `triger_tb_acc_detail_update` BEFORE INSERT ON `tb_acc_detail` FOR EACH ROW begin
set new.cntflag = '1';
end;
CREATE TRIGGER `triger_tb_acc_update` AFTER INSERT ON `tb_acc_detail` FOR EACH ROW begin
update tb_acc a, tb_user_detail b
		set a.avb_amnt =a.avb_amnt + ( case when b.freeze_flag ='0' then 0 else new.amnt end ),
		    a.froze_amnt= a.froze_amnt + (case when b.freeze_flag ='0' then new.amnt else 0 end ),
		    a.total_amnt = a.total_amnt+new.amnt,
		    a.last_caldate = now(),
	                  a.modify_time = now()	
		where a.user_code = b.user_code
		and a.user_code = new.user_code
and new.bouns_source1 <>'40';
INSERT INTO `log_sms` (`ls_phone`, `ls_is_send`,`ls_content`) select phone ,'0',
(case when new.bouns_source1 = '15' then CONCAT('恭喜您获得推介会员【',(select phone FROM tb_user_detail  where user_code = new.rela_usercode),'】购买SAN币时系统赠送的',new.amnt,'SAN币奖励。') end)
 FROM tb_user_detail where user_code = new.user_code;
end;

